Wild about Pandas

Nature Documentary hosted by David Tennant, published by BBC in 2012 - English narration


Information
------------------------------

David Tennant narrates the story of giant pandas Tian Tian and Yang Guang, who arrived in the UK in December 2011 to be resettled in Edinburgh Zoo for the next decade. The film also follows the zoo's vet and head keeper as they travel to China to see how giant pandas are cared for in their homeland, and head keeper Alison visits a remote panda reserve in Wolong to witness the efforts to reintroduce the creatures back into the wild.

